import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Route} from "react-router-dom";
import LoginPage from './Components/LoginPage.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit derp derp <code>src/App.js</code> and save to reload.
        </p>
        <LoginPage/>
       <Route exact path="/"/>
       <Route  path="/characters" component={LoginPage}/>
      </header>
    </div>
  );
}

export default App;
